import react from 'react';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import User from './pages/User/index';

export default function Routes(){
    return(
        <BrowserRouter>
            <Switch>
                <Route path="/" component={User}/> //Caminho e componete para a rota
            </Switch>
        </BrowserRouter>
    );
}
